from gabicalculator import gabicalculator
import fibo

def add_numbers(num1,num2):
    return num1+num2

def substract_numbers(num1,num2):
    return num1-num2

def multiply_numbers(num1,num2):
    return num1*num2

def divide_numbers(num1,num2):
    return num1/num2

def execute_Fibo(num):
    return fibo.fib(num)
